            navigate('/login');
        } catch (error) {
            alert('ÌöåÏõêÍ∞ÄÏûÖ Ïã§Ìå®!');
            console.error(error);
        }
    };

    return (
        <div className="w-96 h-[720px] mt-5 flex flex-col justify-between px-5 py-4 font-sans text-font tracking-tight">
