                    ÏßÄÍ∏à Í∞ÄÏûÖÌïòÍ≥† ITDAÏôÄ Ìï®Íªò<br />ÏÉàÎ°úÏö¥ Ïó¨Ï†ïÏùÑ ÏãúÏûëÌïòÏÑ∏Ïöî.
                </p>
            </div>

            {/* ÌöåÏõêÍ∞ÄÏûÖ Ìèº */}
            <form className="flex flex-col gap-3" onSubmit={handleSubmit}>
                {[
                    { label: "Ïù¥Î¶Ñ", name: "username", type: "text", placeholder: "Ïù¥Î¶ÑÏùÑ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî" },
                    { label: "ÎãâÎÑ§ÏûÑ", name: "nickname", type: "text", placeholder: "Î≥ÑÎ™ÖÏùÑ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî" },
                    { label: "Email", name: "email", type: "email", placeholder: "example@itda.com" },
                    { label: "ÎπÑÎ∞ÄÎ≤àÌò∏", name: "password", type: "password", placeholder: "ÎπÑÎ∞ÄÎ≤àÌò∏" },
                    { label: "ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏", name: "confirmPassword", type: "password", placeholder: "ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏" },
                ].map(({ label, name, type, placeholder }) => (
                    <div key={name} className="flex flex-col gap-0.5">
                        <label className="text-sm font-medium">{label}</label>
                        <input
                            type={type}
                            name={name}
                            value={formData[name]}
                            onChange={handleChange}
                            placeholder={placeholder}
                            className="h-9 rounded-md p-3 bg-slate-50 border outline outline-1 outline-gray-300 hover:border-hover text-sm"
                            required
                        />
                    </div>
                ))}

                <button type="submit" className="w-full mt-1 bg-slate-800 text-white py-3 rounded-md text-sm font-semibold">
                    ÌöåÏõêÍ∞ÄÏûÖ
                </button>
            </form>

            {/* ÏÜåÏÖú Î°úÍ∑∏Ïù∏ */}
            <div className="flex flex-col items-center gap-3">
                <div className="w-full flex items-center gap-2">
                    <hr className="flex-1 border-t border-slate-300" />
                    <span className="text-xs text-gray-500">Or</span>
                    <hr className="flex-1 border-t border-slate-300" />
                </div>
                <SocialLoginButtons />
            </div>

            {/* ÌïòÎã® ÎßÅÌÅ¨ */}
            <div className="text-center text-sm text-gray-600 leading-tight">
                Ïù¥ÎØ∏ Í≥ÑÏ†ïÏù¥ ÏûàÏúºÏã†Í∞ÄÏöî?{" "}
                <Link to="/login" className="text-blue-600 hover:underline">Î°úÍ∑∏Ïù∏</Link>
            </div>
            <div className="text-center text-xs text-slate-400">¬© 2025 ITDA</div>
        </div>
